import React from 'react';
import {NavLink} from 'react-router-dom';


function Content() {
    return (
      <>
        <h1>
          Blockchain Revolution with
          <strong className="brand-name"> BlockEase</strong>
        </h1>
        <h2 className="my-3">
          We can provide Information about Blockchain Technology
        </h2>
        <div className="mt-3">
          <NavLink to="/service" className="btn-get-started">
            
          </NavLink>
        </div>
      </>
    );
}

export default Content;
